script: |
  super -f text -I q8953.spq | sort > q8953.out

inputs:
  - name: q8953.spq
    data: |
      SELECT DISTINCT - col1 + col0 FROM tab0 (FORMAT parquet) WHERE + col0 BETWEEN - ( + col2 ) AND ( - col2 + col2 + col0 + col1 * + col1 );
  - name: tab0

outputs:
  - name: q8953.out
    data: |
      -66
      66
      96
